}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1785552","type":"CustomJS"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","line_width":1.3,"x":{"field":"index"},"y":{"field":"cdl_z(O,H,L,C)_0_1"}},"id":"1785477","type":"Line"},{"attributes":{"fill_color":{"value":"blue"},"hatch_color":{"value":"blue"},"line_color":{"value":"blue"},"size":{"value":8},"x":{"value":1258},"y":{"value":0.007696298101998284}},"id":"1785227","type":"Scatter"},{"attributes":{},"id":"1785297","type":"UnionRenderers"},{"attributes":{},"id":"1785137","type":"SaveTool"},{"attributes":{"line_alpha":{"value":0.1},"line_color":{"field":"returns_positive","transform":{"id":"1785151"}},"line_dash":{"value":"dotted"},"line_width":{"value":8},"xs":{"field":"position_lines_xs"},"ys":{"field":"position_lines_ys"}},"id":"1785423","type":"MultiLine"},{"attributes":{"axis":{"id":"1785123"},"coordinates":null,"group":null,"ticker":null},"id":"1785126","type":"Grid"},{"attributes":{},"id":"1785371","type":"UndoTool"},{"attributes":{"axis":{"id":"1785127"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1785130","type":"Grid"},{"attributes":{"bottom":{"field":"Close"},"fill_alpha":{"v
